import React from "react";

function handleDelete() {
  props.deleteNote
}

function Note(props) {
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={props.deleteNote}>DELETE</button>
    </div>
  );
}

export default Note;
